#include<iostream>
#include<string>
#include<unordered_map>
using namespace std;

class Solution {
public:
	bool isIsomorphic(string s, string t) {
		int len = s.size();
		if (len <= 1)
			return true;
		int index1[256];
		int index2[256];
		for (int i = 0; i < 256; i++)
		{
			index1[i] = -1;
			index2[i] = -1;
		}
		for (int i = 0; i < len; i++)
		{
			if (index1[s[i]] != index2[t[i]])
				return false;
		
			index1[s[i]] = i;
			index2[t[i]] = i;
		}
		return true;
	}
	
};

